import React from 'react';
import classes from './MyPosts.module.css';
import Post from './Post/Post';

const MyPosts = (props) => {

    const posts = [
        {id: '1', message: 'Hi', likesCounter: '15'},
        {id: '1', message: 'It\'s my first post', likesCounter: '25'},
        {id: '1', message: 'Огогогого', likesCounter: '18'},
        {id: '1', message: 'Ну шо ты, голова?', likesCounter: '29'},
    ];

    let postsElements = posts.map(post => <Post id = {post.id} message = {post.message} likesCount = {post.likesCounter}/>)
    return (

        <div className={classes.post_block}>
            <h3>My posts</h3>
            <div>
                <div><textarea></textarea></div>
                <div>
                    <button>Add new post</button>
                </div>
            </div>
            <div className={classes.posts}>
                {postsElements}
            </div>
        </div>

    )
}

export default MyPosts;
